  input: "TEXT\x1CC00215699\x1CTEXT.1\x1C\x1CF3A\x1CTo the best of the treasurers
    knowledge, this quarterly FEC report is true, correct and complete as it pertains
    to contributions and disbursements for the dates covered.  However, there remain
    errors in the cycle-to-date figures dating back prior to 2007, which are due to
    the embezzlement of Committee funds and the alteration and/or destruction of records
    by a former campaign employee. This matter was reported in detail to the authorities
    and is under active review by the FEC and the FBI.    We are amending the Q2,
    2009 and Q3 2009 reports. The original submissions of these reports reflected
    a settlement of campaign debts in the amount of $7,056.76. Although the debtors
    have agreed to these settlements, the FEC is awaiting a full debt settlement plan
    before they will accept these settlements. Accordingly, we are restoring the settled
    debts to line 10 pending final FEC approval.\x1C\n"
